CREATE PROCEDURE dbo.proc_transform_63
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_63
    SET payload = LEFT(payload, 1000) + N'|V4-63|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_63;
END
